import React from 'react';

const Product = ({productData}) => {
    return (
        <div>
            <img src={productData.image} alt="product"/>
            <h3>{productData.title}</h3>
            <p>Price</p>
            <div>
                <a href='www.google.com'>Details</a>
                <div>
                    <button>
                        Add to card
                    </button>
                </div>
            </div>
        </div>
    );
};

export default Product;
